As part of the House’s continued efforts to foster independent young talents in the industry, Gucci supports emerging Haitian American designer Azède Jean-Pierre through a knitwear-focused, limited-edition selection of pieces available in the U.S. at Gucci Wooster in New York and Dover Street Market Los Angeles. Azède enlisted writer and director @ibraake to create a video to showcase the pieces seen here on models @altonmason and Riley Montana @loveme_rileym, styled by @kollincarter, and featuring words and music by fellow Haitian artist @wyclefjean with choreography by Fatima Robinson @fatima_noir. Directed by Ibra Ake.
In honor of the launch, a donation will be made to non-profit organization CORE @coreresponse to support their ongoing relief work in Haiti.
